      return (
        <li key={pokeitem.id} className="eachPokemon">
          {" "}
          {pokeitem.id} - {pokeitem.name} <img src={pokeitem.url} />
        </li>
      );
    });

    return
    <div> 


    <ul>{ePokemon}</ul>

    </div>;
  }
}
export default PokeList;
